import React from "react"

export default function Albums() {
    return (
        <div className="album-container">
            <div className="album-cover"></div>
                <h3 className="artist">Artist</h3>
                <h3 className="album">Album Name</h3>
                <p className="album-description">The 13-track LP is the South Carolina-bred, Bay Area-based chillwave veteran’s seventh as Toro y Moi.“Postman” is a slinky psych-funk jam, powered by bass, tambourine and Bear’s breezy, Bootsy Collins-esque vocal, punctuated by occasional electric yelps. The track’s minimal, almost childlike lyrics find Bear on the lookout for a letter that may or may not ever arrive. The visual (dir. Kid. Studio), meanwhile, finds him exploring San Francisco in the Filipino jeepney that graces the cover of Mahal, morphing from live action into animation during the song’s danceable double-time breakdown. “Magazine” is far dreamier, though its shuffling drum beat still keeps things brisk. Bear shares vocal duties with his Bay Area ally Salami Rose Joe Louis, whose breathy voice adds an ethereal quality to the track. Watery keys frame Bear’s musings on being overwhelmed by the world we see both in the media and outside our front door. The video (dir. Arlington Lowell) is appropriately overwhelming, with Bear and Salami Rose Joe Louis performing the song through layers of colorful imagery.</p>
                <a className="album-link" href="link-here">Bandcamp link</a>
        </div>
    )
}
